import React from "react";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faXmark, faStarHalfStroke } from "@fortawesome/free-solid-svg-icons";

import { faStar as emptyStar } from "@fortawesome/free-regular-svg-icons";
import { faStar as filledStar } from "@fortawesome/free-solid-svg-icons";

export default function mapResults({ points }) {
  const searchResults = points;

  const starRating = (rating) => {
    let stars;

    for (let i = 1; i <= 5; i++) {
      if (rating >= i) {
        // Full star
        stars += <FontAwesomeIcon icon={filledStar} />;
      } else if (rating >= i - 0.5) {
        // Half star
        stars += <FontAwesomeIcon icon={faStarHalfStroke} />;
      } else {
        // Empty star
        stars += <FontAwesomeIcon icon={emptyStar} />;
      }

      return stars;
    }
  };
  return (
    <div className="map-results">
      <div className="map-results-header">
        <h2>Results</h2>
        <button className="map-results-btn">
          <FontAwesomeIcon icon={faXmark} className="icon" />
        </button>
      </div>
      <div className="all-map-results">
        {searchResults.map((result) => (
          <div className="map-result">
            <div className="map-result-container">
              <div className="map-result-name">{result.name}</div>
              <div>
                {result.rating}
                {starRating(result.rating)}({result.user_ratings_total})
              </div>
              <div>
                {result.types[0].capitalize()}*{result.vicinity}
              </div>
              <div className="map-result-open">Open</div>
            </div>
            <div className="map-result-details">
              <button>More Details</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
